import React, { Component } from 'react';
import './App.css';
import Card from './Components/Card'

import {BrowserRouter} from 'react-router-dom'
import Blog from './Blog/Blog'; 

class App extends Component {
 
    render() {
        return (
          <BrowserRouter>
            <div className="App">
               <Blog/>
            </div>
          </BrowserRouter>
        )
      }
    }

export default App;
